data = np.vstack(data)
labels_num = np.hstack(labels_num)

# 定义颜色
# colors = plt.cm.get_cmap('tab10', num_classes)

# 绘制散点图
fig, axes = plt.subplots(figsize=(10, 8))

for i in range(num_classes):
    class_data = data[labels_num == i]
    plt.scatter(class_data[:, 0], class_data[:, 1], color=colors[i], label=labels_real[i], alpha=0.4)

    # 使用K-means聚类来计算每个类别的聚类中心
    kmeans = KMeans(n_clusters=1).fit(class_data)
    center = kmeans.cluster_centers_[0]
    
    # 计算每个点到聚类中心的距离
    distances = np.linalg.norm(class_data - center, axis=1)
    
    # 计算第80百分位数作为半径
    radius = np.percentile(distances, 80)
    
    # 为每个类别添加一个圆圈
    circle = plt.Circle(center, radius=radius, color=colors[i], fill=False, linestyle='--', linewidth=1.5)
    plt.gca().add_patch(circle)
    

    
